const PageHeader = (props) => (
    
  <section className="page-header d-flex align-items-center py-5 bg-img1">
    <div className="container text-center">
      <div className="hero-content style1">
        <h1 className="text-white"></h1>
        <h4 className="text-capitalize text-white">
          Learn about us and what drives us
        </h4>
      </div>
    </div>
  </section>
);

export async function getStaticProps() {
  
    const content = await import('../_data/content.json');
    
    // By returning { props: posts }, the Blog component
    // will receive `posts` as a prop at build time
    return {
      props: {
        content,
      },
    }
  }

export default PageHeader;
